import org.testng.Assert;
import org.testng.annotations.Test;

/**
 * User: jicui
 * Date: 14-10-9
 */
@Test
public class BodyXMLCompilerTest {

    @Test
    public void test_compile_fail_with_delimeters(){
        String dsl="<soapenv:Envelope xmlns:soapenv=\\\"http://schemas.xmlsoap.org/soap/envelope/\\\">\n" +
                "   <soapenv:Header/>\n" +
                "   <soapenv:Body>\n" +
                "   </soapenv:Body>\n" +
                "</soapenv:Envelope>";
        try {
            new BodyXMLCompiler().compile(dsl);
        } catch (CompileException e) {
            Assert.assertEquals(e.getErrorCode().getCode(), CompileErrorCode.INVALID_BODY_XML_VALUE.getCode());
        }
    }

    @Test
    public void test_compile_success(){
        String dsl="<soapenv:Envelope xmlns:soapenv=\"http://schemas.xmlsoap.org/soap/envelope/\">   <soapenv:Header/>   <soapenv:Body>      <ship:ShipmentResponse xmlns:ship=\"http://www.ups.com/XMLSchema/XOLTWS/Ship/v1.0\">         <common:Response xmlns:common=\"http://www.ups.com/XMLSchema/XOLTWS/Common/v1.0\">            <common:ResponseStatus>               <common:Code>1</common:Code>               <common:Description>Success</common:Description>            </common:ResponseStatus>            <common:Alert>               <common:Code>121524</common:Code>               <common:Description>The payer of Duty and Tax charges is not required for UPS Letter, Documents of No Commercial Value or Qualified Domestic Shipments.</common:Description>            </common:Alert>            <common:Alert>               <common:Code>126098</common:Code>               <common:Description>Account authentication is required to be completed to get negotiated rates.</common:Description>            </common:Alert>            <common:TransactionReference/>         </common:Response>         <ship:ShipmentResults>            <ship:ShipmentCharges>               <ship:TransportationCharges>                  <ship:CurrencyCode>USD</ship:CurrencyCode>                  <ship:MonetaryValue>24.50</ship:MonetaryValue>               </ship:TransportationCharges>               <ship:ServiceOptionsCharges>                  <ship:CurrencyCode>USD</ship:CurrencyCode>                  <ship:MonetaryValue>0.00</ship:MonetaryValue>               </ship:ServiceOptionsCharges>               <ship:TotalCharges>                  <ship:CurrencyCode>USD</ship:CurrencyCode>                  <ship:MonetaryValue>24.50</ship:MonetaryValue>               </ship:TotalCharges>            </ship:ShipmentCharges>            <ship:BillingWeight>               <ship:UnitOfMeasurement>                  <ship:Code>LBS</ship:Code>                  <ship:Description>Pounds</ship:Description>               </ship:UnitOfMeasurement>               <ship:Weight>0.0</ship:Weight>            </ship:BillingWeight>            <ship:ShipmentIdentificationNumber>1Z18V5310297280760</ship:ShipmentIdentificationNumber>            <ship:PackageResults>               <ship:TrackingNumber>1Z18V5310297280760</ship:TrackingNumber>               <ship:ServiceOptionsCharges>                  <ship:CurrencyCode>USD</ship:CurrencyCode>                  <ship:MonetaryValue>0.00</ship:MonetaryValue>               </ship:ServiceOptionsCharges>               <ship:ShippingLabel>                  <ship:ImageFormat>                     <ship:Code>GIF</ship:Code>                     <ship:Description>GIF</ship:Description>                  </ship:ImageFormat>                  <ship:GraphicImage></ship:GraphicImage>                  <ship:HTMLImage></ship:HTMLImage>               </ship:ShippingLabel>            </ship:PackageResults>         </ship:ShipmentResults>      </ship:ShipmentResponse>   </soapenv:Body></soapenv:Envelope>";
        try {
            new BodyXMLCompiler().compile(dsl);
        } catch (CompileException e) {
            e.printStackTrace();
        }
    }
}
